import React, { useState, useEffect } from 'react';
import styles from "./Container5.module.css";

const Container5 = () => { 
  const [counter, setCounter] = useState(400);

  useEffect(() => {
    const interval = setInterval(() => {
      setCounter(prev => (prev === 500 ? 400 : prev + 1)); // Cycle from 400 to 500
    }, 1000); // Update every second

    return () => clearInterval(interval);
  }, []);

  return (
    <div className={styles.Container5}>
      <div className={styles.Container5Main}>
        <div className={styles.Container5LeftContainer}>
          <h1>What we do?</h1>
          <p>We offer comprehensive services that cater to a broad spectrum of needs and clients, ensuring satisfaction across diverse requirements.</p>
          <h2>{counter}+ Projects Completed</h2> {/* Animated counter */}
        </div>
        <div className={styles.Container5RightContainer}>
          <img
            className={styles.Container5Img}
            loading="lazy"
            alt="Service Visualization"
            src="/image.png"
          />
        </div>
      </div>
    </div>
  );
};

export default Container5;
